 // Dialog\n  readonly dialogRef = inject(MatDialogRef);\n\n  // Form\n  private readonly _formBuilder = inject(FormBuilder);\n  networkInterfaceCreateFormGroup = this._formBuilder.group({\n    name: [''],\n    mac_address: [''],\n    ipv4_address: [''],\n    ipv6_address: [''],\n  });\n\n  // Unsubscribe\n  private ngUnsubscribe = new Subject();\n\n  constructor(\n    public userService: UserService,\n    private cobblerApiService: CobblerApiService,\n    private _snackBar: MatSnackBar,\n    @Inject(MAT_DIALOG_DATA) public data: NetworkInterfaceDialogData,\n  ) {}\n\n  ngOnDestroy(): void {\n    this.ngUnsubscribe.next();\n    this.ngUnsubscribe.complete();\n  }\n\n  createNetworkInterface(): void {\n    const interfaceName =\n      this.networkInterfaceCreateFormGroup.get('name').value;\n    const networkInterfaceMap = new Map();\n    networkInterfaceMap.set(\n      'macaddress-' + interfaceName,\n      this.networkInterfaceCreateFormGroup.get('mac_address').value,\n    );\n    networkInterfaceMap.set(\n      'ip_address-' + interfaceName,\n      this.networkInterfaceCreateFormGroup.get('ipv4_address').value,\n    );\n    networkInterfaceMap.set(\n      'ipv6_address-' + interfaceName,\n      this.networkInterfaceCreateFormGroup.get('ipv6_address').value,\n    );\n    this.cobblerApiService\n      .get_system_handle(this.data.systemName, this.userService.token)\n      .pipe(takeUntil(this.ngUnsubscribe))\n      .subscribe({\n        next: (systemHandle) => {\n          this.cobblerApiService\n            .modify_system(\n              systemHandle,\n              'modify_interface',\n              networkInterfaceMap,\n              this.userService.token,\n            )\n            .pipe(takeUntil(this.ngUnsubscribe))\n            .subscribe({\n              next: () => {\n                this.cobblerApiService\n                  .save_system(systemHandle, this.userService.token)\n                  .pipe(takeUntil(this.ngUnsubscribe))\n                  .subscribe(() => {\n                    this.dialogRef.close(interfaceName);\n                  });\n              },\n              error: (err) => {\n                // HTML encode the error message since it originates from XML\n                this._snackBar.open(Utils.toHTML(err.message), 'Close');\n              },\n            });\n        },\n        error: (err) => {\n          // HTML encode the error message since it originates from XML\n          this._snackBar.open(Utils.toHTML(err.message), 'Close');\n        },\n      });\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"components/NetworkInterfaceEditComponent.html":{"url":"components/NetworkInterfaceEditComponent.html","title":"component - NetworkInterfaceEditComponent","body":"\n                   \n\n\n\n\n\n  Components\n  \n  NetworkInterfaceEditComponent\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n        \n            Template\n        \n        \n            DOM Tree\n        \n\n\n\n    \n    File\n\n\n    projects/cobbler-frontend/src/app/items/network-interface/edit/network-interface-edit.component.ts\n\n\n\n\n\n    \n        Implements\n    \n    \n                OnInit\n                OnDestroy\n    \n\n\n\n    Metadata\n    \n        \n\n\n\n\n\n\n\n\n\n\n\n\n            \n                selector\n                cobbler-network-interface-edit\n            \n\n            \n                standalone\n                true\n            \n\n            \n                imports\n                \n                            MatFormFieldModule\n                            MatInputModule\n                                KeyValueEditorComponent\n                            MatButtonModule\n                            MatCheckboxModule\n                                MultiSelectComponent\n                            ReactiveFormsModule\n          